const Header = () => {
    return (
        <div className='text-c'>
            <h1 className='text-5xl font-bold my-8 uppercase'>Test your programming knowledge</h1>
            <h3 className='text-2xl'>Participate below quiz.</h3>
        </div>
    );
};

export default Header;
